INSERT INTO kaob.memory (id, user_id, title, text, timestamp) VALUES (1, 1, 'Unistuste nukk', e'les kasvades ei olnud meil palju raha, pigem lausa vastupidi, tulime vaevu ots-otsaga kokku nii et mingisugust luksust me endale lubada ei saanud. Olin sellega harjunud ja mind isegi ei hirinud, kui teistel olid uuemad rivad vi mnguasjad. Olin nnelik isegi selle le, kui ema mu aeg-ajalt mnguasja kauplusesse viis ja ma sain seal lihtsalt ringi vaadata. Kuid siis ngin ma hte nukku  ta sulges pikali olles silmad ja seljale patsutades tles piiksuva hlega Ma-ma. Vaatasin emale otsa, kuid ei sandanud ksida. Ema naeratas nukralt, paitas mu pead ja me lksime koju.
